import { Fragment } from 'react'

import Button from './UI/Button'
import Header from './UI/Header'
import Card from './UI/Card'


const App = () => {
  return (
    <Fragment>
      <Header><Button>Profile</Button><Button>Log in</Button></Header>
      <Card><Button>Register</Button></Card>
    </Fragment>
  );
}

export default App;
